//SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

//import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";

contract MoreNFT is ERC721URIStorage {

    uint public tokenCounter;

    constructor() ERC721("MoreNFT", "MORE") {
        tokenCounter = 0;
    }

    function createNFTs (string memory tokenURI) public returns (uint) {
        uint newTokenId = tokenCounter;
        _safeMint(msg.sender, newTokenId);
        _setTokenURI(newTokenId, tokenURI);
        tokenCounter++;
        return newTokenId;
    }

    function burn(uint256 newTokenId) public virtual {
        require(_isApprovedOrOwner(msg.sender, newTokenId), "You are not authorized to do this!");
        super._burn(newTokenId);
    }

}
